import base64
import io
from PIL import Image
import numpy as np
import cv2

base64_image = ''
file_like = io.BytesIO(base64.b64decode(base64_image))
image_input = Image.open(file_like)

frame = np.array(image_input)
if frame is None:
    print("HELOO")
frame = cv2.cvtColor(frame, cv2.COLOR_BGR2RGB)
cv2.imshow('face', frame)
cv2.waitKey(0)
